import React from "react";
import classes from "./Banner.module.css";

export default function Banner({ imgPath, name, overview }) {
  return (
    <div>
      <img className={classes["banner-img"]} src={imgPath} alt="banner" />
      <div className={classes.about.slice(0, 40)}>
        <h2>{name}</h2>
        <p>{overview}</p>
      </div>
    </div>
  );
}
